CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_apply_leave` (IN `p_user_id` INT, IN `p_leave_type_id` INT, IN `p_start_date` DATE, IN `p_end_date` DATE, IN `p_reason` TEXT, IN `p_half_day` BOOLEAN)   BEGIN
    INSERT INTO leaves (
        user_id, 
        leave_type_id, 
        start_date, 
        end_date, 
        reason, 
        half_day
    ) VALUES (
        p_user_id,
        p_leave_type_id,
        p_start_date,
        p_end_date,
        p_reason,
        p_half_day
    );
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_update_leave_status` (IN `p_leave_id` INT, IN `p_status` ENUM('pending','approved','rejected'), IN `p_comments` TEXT, IN `p_modified_by` INT)   BEGIN
    DECLARE current_status VARCHAR(20);
    
    -- Get current status
    SELECT status INTO current_status 
    FROM leaves 
    WHERE id = p_leave_id;
    
    -- Update leave status
    UPDATE leaves 
    SET 
        status = p_status,
        modified_by = p_modified_by,
        modified_at = CURRENT_TIMESTAMP
    WHERE id = p_leave_id;
    
    -- Record in history
    INSERT INTO leave_history (
        leave_id,
        status_from,
        status_to,
        comments,
        created_by
    ) VALUES (
        p_leave_id,
        current_status,
        p_status,
        p_comments,
        p_modified_by
    );
END$$

